import {Link,useParams } from "react-router-dom";

function Navbar({}){
    return (
    <div>
        <Link to="/">Home</Link>
        <Link to="/user">User</Link>
        <Link to="/login">Login</Link>
        <Link to="/projects">Home</Link>
    </div>
    )
}
export default Navbar
